import React from "react";
import { tw } from "twind";

export default function App() {
  return (
    <div className={tw`font-raleway text-center`}>
      <div className={tw`bg-gray-900 text-white p-20 mx-auto max-w-screen-md`}>
        <h1 className={tw`text-4xl font-bold mb-4`}>Hey there, I'm Olya.</h1>
        <p className={tw`text-lg`}>Find me on my socials</p>
      </div>
    </div>
  );
}
